import ThemeOptions from './ThemeOptions';
import accountReducer from './account/accountReducer';
import masterdataReducer from './masterdata/masterdataReducers';
import coursesReducer from "../reducers/courses/courses";
import invoicesReducer from "../reducers/invoices";
export default {
    ThemeOptions,
    accountReducer,
    masterdataReducer,
    coursesReducer,
    invoicesReducer,
};
